import React from 'react';
import axios from 'axios';
import Head from 'next/head';
import { Container, Jumbotron, Button } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Menu from '../components/Menu';
import "../style.css"
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';
library.add(fas);

const Home = data => (
    <div>
        <Head>
            <title>Home - Rany Silva</title>
            <meta name="Description" content="Frango e Pescados" />
            <meta name="author" content="Paulo Teixeira" />
        </Head>
        <Menu />
        <Jumbotron fluid className="descr-top">
            <style>{`.descr-top{
                background-color: #000;
                color: #fff;
                padding-top: 150px;
                padding-bottom: 100px;
                margin-bottom: 0rem !important;
                position: relative;
            }.inicio-link{
                position: absolute;
                top: 0px;
            }`}</style>
            <Container className="text-center">
                <a name="inicio" className="inicio-link"/>
                <img src="logo.png" className="logo" alt="logo tipo"/>
                <h1 className="display-4 mb-4">Frangos e Pescados</h1>
                <p className="lead mb-4">
                    Trabalhamos de quarta à segunda com produtos frescos e selecionados.<br />
                    Frango abatido e peixe de água salgada e doce. 
                </p>

            </Container>
        </Jumbotron>

        <Jumbotron fluid className="servicos">
            <style>{`.servicos{
                background-color: #fff;
                padding-top: 80px;
                padding-bottom: 80px;
                margin-bottom: 0rem !important;
                position: relative;
            }.servico-link{
                position: absolute;
                top: 0px;
            }.circulo{
                width: 140px;
                height: 140px;
                background-color: #fed136;
                font-size: 52px;
                padding-top: 30px;
                color: #fff;
            }.centralizar{
                margin: 0 auto !important;
                float: none !important;
            }`}</style>
            <Container className="text-center">
                <a name="servico" className="servico-link"/>
                <div>
                    <h2 className="display-4">Serviços</h2>
                    <p className="lead pb-4">Melhor frango e peixe da cidade</p>
                </div>
                <div className="row">
                    <div className="col-lg-4">
                        <div className="rounded-circle circulo centralizar">
                            <FontAwesomeIcon icon="fish"/>
                        </div>
                        <h2 className="mt-4 mb-4">Peixe</h2>
                        <p>Água doce e salgada</p>
                    </div>
                    <div className="col-lg-4">
                        <div className="rounded-circle circulo centralizar">
                            <FontAwesomeIcon icon="drumstick-bite"/>
                        </div>
                        <h2 className="mt-4 mb-4">Frango</h2>
                        <p>Frango abatido</p>   
                    </div>
                    <div className="col-lg-4">
                        <div className="rounded-circle circulo centralizar">
                            <FontAwesomeIcon icon="carrot"/>
                        </div>
                        <h2 className="mt-4 mb-4">Frutas e Verduras</h2>
                        <p>Frutas e legumes frescos</p>
                    </div>
                </div>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="portfolio">
            <style>{`.portfolio{
                background-color: #f8f9fa;
                padding-top: 80px;
                padding-bottom: 80px;
                margin-bottom: 0rem !important;
                position: relative;
            }.portfolio-link{
                position: absolute;
                top: 0px;
            }`}</style>
            <Container className="text-center">
                <a name="portfolio" className="portfolio-link"/>
                <div>
                    <h2 className="display-4">Portfólio</h2>
                    <p className="lead pb-4">Descrição portfólio</p>
